import React from 'react';
import PropTypes from 'prop-types';
const AppLayout = ({ children }) => {
    return (
        <div>
            <div>공통 메뉴</div>
            {children}
        </div>
    )
}

AppLayout.propTypes = {
    children: PropTypes.node.isRequired // 리액트에서의 node: return안의 것들의 타입
}

export default AppLayout;
